import styled from "styled-components";

export const ModalBG = styled.div`
  position: absolute;
  background: rgba(0, 0, 0, 0.95);
  top: 0px;
  left: 0px;
  height: 100%;
  width: 100%;
  color: #fff;
  pointer-events: all;
  z-index: 1000;
  /* transition: all 1s cubic-bezier(0.0,0.0,0.2,1); */
  display: grid;
  place-items: center;
  border-radius: 5px;
`;
